class Image(Drawable):
    width = 0
    height = 0
    hex = 0

    def __init__(self, w, h, bytes):
        if 4 * w * h != len(bytes):
            print(("WRONG IMAGE DIMENSIONS: " + str(len(bytes))))
        self.hex = bytes
        self.width = w
        self.height = h
        pass

    def draw(self, x, y):
        for x in range(self.width):
            for y in range(self.height):
                i = 4 * (y * self.height + x)
                brain.screen.set_pen_color(vex.Color.from_rgb(self.hex[i + 1], self.hex[i + 2], self.hex[i + 3]))
                brain.screen.draw_pixel(x, y)
        pass

    def onClick(self):
        pass


